#include <stdio.h>
#include <stdbool.h>

#define N 64

// 64x64 Baseline C Code for Subsequent Vectorization

bool is_valid(int grid[N][N], int r, int c, int k) {
    bool not_in_row = true;
    for (int i = 0; i < N; i++) {
        if (grid[r][i] == k) {
            not_in_row = false;
            break;
        }
    }
    
    bool not_in_column = true;
    for (int i = 0; i < N; i++) {
        if (grid[i][c] == k) {
            not_in_column = false;
            break;
        }
    }
    
    bool not_in_box = true;
    int box_r = r / 8 * 8;
    int box_c = c / 8 * 8;
    for (int i = box_r; i < box_r + 8; i++) {
        for (int j = box_c; j < box_c + 8; j++) {
            if (grid[i][j] == k) {
                not_in_box = false;
                break;
            }
        }
    }
    
    return not_in_row && not_in_column && not_in_box;
}

bool solve(int grid[N][N], int r, int c) {
    if (r == N) {
        return true;
    } else if (c == N) {
        return solve(grid, r + 1, 0);
    } else if (grid[r][c] != 0) {
        return solve(grid, r, c + 1);
    } else {
        for (int k = 1; k <= 64; k++) {
            if (is_valid(grid, r, c, k)) {
                grid[r][c] = k;
                if (solve(grid, r, c + 1)) {
                    return true;
                }
                grid[r][c] = 0;
            }
        }
        return false;
    }
}

void print_grid(int grid[N][N]) {
    for (int i = 0; i < N; i++) {
        for (int j = 0; j < N; j++) {
            printf("%d ", grid[i][j]);
        }
        printf("\n");
    }
}

